import React from "react";

import { Grid } from '@material-ui/core';

import CustomPieChart from "components/Graphs/PieChart";

const moreStyles = makeStyles(() => ({
    grid: {
        display: 'flex',
        flexFlow: 'row wrap'
    }
}))

export default function Kpi4(props) {

    console.log(props);

    return (
        <Grid container>
            <Grid item>
                <CustomPieChart products={props.products} />
            </Grid>
            <Grid item>
                <CustomPieChart totalSales={props.totalSales} />
            </Grid>
        </Grid>
    )
}
